INSERT INTO `ucp_news` (`id`, `author`, `title`, `text`, `likes`, `date`) VALUES
(1, 'Evgeniy_Green', 'Патч от 11.02.18', '<p>1) <strong>Исправление ошибок:</strong></p>\n<ul>\n<li>&nbsp;<span style="color: #3366ff;">Фикс выхода из автомастерской при продаже недвижимости;</span></li>\n<li><span style="color: #3366ff;">&nbsp;Фикс удаление неоновый ламп при выигрыше в рулетке;</span></li>\n<li><span style="color: #3366ff;">&nbsp;Фикс ошибок в система спарринга в спортзале;</span></li>\n<li><span style="color: #3366ff;">&nbsp;Фикс ошибок с системой выговоров у администрации;</span></li>\n<li><span style="color: #3366ff;">&nbsp;Фикс бага с командой /ceject;</span></li>\n<li><span style="color: #3366ff;">&nbsp;Фикс нового крашера (через систему поцелуев);</span></li>\n</ul>\n<p>2) <strong>Обновление Армии Авианосец:</strong></p>\n<ul>\n<li><span style="color: #3366ff;">Добавлено два новых лифта;</span></li>\n<li><span style="color: #3366ff;">Новая расстановка гидр и апачей + добавлена новая лодка;</span></li>\n</ul>\n<p>3) <strong>Прочее:</strong></p>\n<ul>\n<li><span style="color: #3366ff;">Обновлен парсер объектов;</span></li>\n<li><span style="color: #3366ff;">Теперь шлагбаум может быть закрыт раньше времени (повторное нажатие клавиши F или H за рулем);</span></li>\n</ul>\n<p style="text-align: center;"><img src="https://pp.userapi.com/c841530/v841530984/68ca5/Q2MGTBel2TM.jpg" alt="" width="839" height="472" /></p>\n<p style="text-align: center;">&nbsp;</p>\n<p style="text-align: center;"><img src="https://pp.userapi.com/c841530/v841530984/68caf/6Q69Sm4H7mE.jpg" alt="" width="828" height="466" /></p>\n<p style="text-align: center;">&nbsp;</p>\n<p style="text-align: center;"><img src="https://pp.userapi.com/c841530/v841530984/68cb9/s8_xbqt2uI8.jpg" alt="" width="818" height="460" /></p>', 106, '2018-02-25 11:49:22'),
(2, 'Evgeniy_Green', 'Обновление мода  1.01 ', '<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;"><img src="https://picua.org/images/2019/03/10/dbb2c71d3fd7c3655eb833ad4fabfb17.jpg" alt="dbb2c71d3fd7c3655eb833ad4fabfb17.jpg" border="0" /></p>\r\n<p style="text-align: center;"><strong>Основные нововведения:</strong></p>\r\n<ul>\r\n<li style="text-align: left;"><span style="color: #666699;">Переписана команда <strong>/wanted</strong>. Со списка преступников убрано отображение администраторов. При снятии розыска добавлено повещение всем законникам.&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Исправлены баги с квестами. Все сюжетные линии функционируют нормально и доступны для прохождения <strong>(/quest)</strong></span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Удален лишний маппинг (Статуя Свободы и прочее)&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Обновлен античит. Добавлена возможность уравление античитом прямо из игры. Просьба при ложных срабатываних незамедлительно сообщать руководству.&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Добавлена новая система оглушения <strong>(/tazer) .&nbsp;&nbsp;</strong>Теперь оружие <strong>(SD Pistol / DesertEagle / Shoutgun)</strong> можно заряжать парализующими патронами, которые не наносят урон, а оглушают. Для разрядки парализующих патронов достаточно ввести<strong> /tazer</strong> еще раз.&nbsp;</span><br /><span style="color: #666699;">После оглушения оружием нажав на горячую клавишу <strong>"H"</strong> возле оглушенного можно надеть на него наручники (у человека должен быть розыск)&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Переписана система обыска<strong> (/frisk)</strong>. Теперь обыскивать другого может абсолютно любой игрок, в независимости от фракции. Однако, для этого необходимо подтверждение действия от обыскиваемого <strong>(Y - подтвердить, N - отказаться)</strong>. Если обыскиваемый находится в наручниках либо оглушен, подтверждение не требуется.&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">FBI добавлена возможность садиться в фракционный транспорт той организации, которой была взята маскировка. То есть, если вам была взята маскировка Ballas , вы сможете свободно ипользовать транспорт этой банды, но только при маскировке.&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Новая система поворотников. Теперь находясь в транспорте можно активировать левый и правый поворотники (<strong>Num 4 и Num 6</strong> соответственно), а так же включать аварийку <strong>(Num 8</strong>)</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Доработана система репорта. Теперь после ответа, вы сможете узнать время, в течении которого ваш запрос был обработан администрацией.</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Переписана система мута. Исправлены все сопутствующие ошибки&nbsp;</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Убрана необходимость отыграть 7 часа для оплаты дома на более длительный срок</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Добавлен женский скин в SWAT</span></li>\r\n<li style="text-align: left;"><span style="color: #666699;">Добавлена возможность оглушать сотрудников гос. организаций (Медики, Инструкторы, San News)&nbsp;</span></li>\r\n</ul>\r\n<p style="text-align: center;"><strong>Исправление ошибок:</strong></p>\r\n<ul>\r\n<li style="text-align: left;">&nbsp;<strong><span style="color: #666699;">Исправлена ошибка с дергающимся транспортом у Хитманов.&nbsp;</span></strong></li>\r\n<li style="text-align: left;"><strong><span style="color: #666699;">&nbsp;Исправлена ошибка с сохранением оружия при выходе.</span></strong></li>\r\n<li style="text-align: left;"><strong><span style="color: #666699;">&nbsp;Исправлены ошибки, связанные с использованием промокодов.&nbsp;</span></strong></li>\r\n<li style="text-align: left;"><strong><span style="color: #666699;">&nbsp;Исправлена ошибка, с состоянием замков мопедов на спавне</span></strong></li>\r\n<li style="text-align: left;"><strong><span style="color: #666699;">&nbsp;Исправлена ошибка с использованием чат хелперов&nbsp;&nbsp;</span></strong></li>\r\n</ul>', 21, '2019-03-10 16:16:08');
